import React from "react";
import './App.css';

function App() {
  return (
    <div className="card border border-info">
      <form>
        <input
          type="search"
          placeholder="search for name ..."
          aria-label="Search"
        />
        <i className="fa fa-female "></i>
        <i className="fa fa-male text-info"></i>
        <i className="fa fa-child text-success"></i>
      </form>
      <p>Favourites:</p>
      <hr />
      <ul>
        <li></li>
      </ul>
      <hr />
    </div>
  );
}

export default App;
